import React from 'react';

const ViewDataPage = ({ uploads, setCurrentPage }) => {
    return (
        <div className="view-data-page">
            <h1>View Uploaded Data</h1>
            {Object.keys(uploads).length === 0 ? (
                <p>No data uploaded yet.</p>
            ) : (
                Object.entries(uploads).map(([date, data], index) => (
                    <div key={index} className="diary-entry">
                        <h3>{date}</h3>
                        <p>{data.text}</p>
                        <div className="images">
                            {data.images.map((image, i) => (
                                <img key={i} src={image} alt="upload" style={{ width: "100px", margin: "5px" }} />
                            ))}
                        </div>
                    </div>
                ))
            )}
            <button onClick={() => setCurrentPage('calendar')}>Back to Calendar</button>
        </div>
    );
};

export default ViewDataPage;
